description:
Movie Info: Prema Oka Maikam is a 2013 Telugu film directed by Chandu. It was released on August 30, 2013 and stars Charmy Kaur, Rahul, and Saranya Nag as the lead characters. The film's script was written by Chandu and Pulagam Chinnarayana, who worked as the script's dialogue writer.

Prema Oka Maikam has been described as &quot;a film for men, especially for those men who enjoy being drowsy and drowned into love, lust or wine&quot; and Chandu commented that Charmy &quot;has given soul to the character and will win all the hearts&quot;.


